import { makeStyles } from "@material-ui/core/styles";

interface stylesProps {
    error?: string,
}

const useStyles = makeStyles((theme) => ({
    root: {},
    textCheckbox: {
        fontSize: 14,
        textAlign: "left",
        marginLeft: 8,
        "& a": {
            color: "#263C70",
            textDecoration: "none",
            fontWeight: "bold"
        }
    },

}));

export default useStyles;
